BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "Devices" (
	"id"	INTEGER,
	"device_name"	TEXT,
	PRIMARY KEY("id")
);
CREATE TABLE IF NOT EXISTS "Transactions" (
	"id"	SERIAL,
	"datetime"	INTEGER,
	"visitor_id"	INTEGER,
	"device_type"	INTEGER,
	"revenue"	REAL,
	"tax"	REAL,
	PRIMARY KEY("id"),
	FOREIGN KEY("device_type") REFERENCES "Devices"("id")
);
CREATE TABLE IF NOT EXISTS "sqlite_stat4" (
	"tbl"	,
	"idx"	,
	"neq"	,
	"nlt"	,
	"ndlt"	,
	"sample"	
);
COMMIT;
